#include "NBSubscribeStarAPITokenInfo.h" #define CLIENT_ID TEXT("<Your Client ID>")
#define CLIENT_SECRET TEXT("<Your Client Secret>") void MyClass::DoSubscribeStarLogin() { // create an authentication action expecting a callback at http://localhost/login:8080 UNBSSAuthenticationAction* authAction = UNBSSAuthenticationAction::PerformAuthenticationAsyncAction( this, // world context CLIENT_ID, CLIENT_SECRET // scopes default to "subscriber.read+user.read" // callback route defaults to "/login" // callback port defaults to 8080 ); // register callbacks for results authAction->OnComplete.AddDynamic(this, &MyClass::OnAuthenticationComplete); authAction->OnFail.AddDynamic(this, &MyClass::OnAuthenticationFailed); // kick off action authAction->Activate();
} void MyClass::OnAuthenticationComplete(FNBSubscribeStarAPITokenInfo TokenInfo) { // now that we have a token, we can use it to fetch information about the user who just logged in UNBSSGetUserInfoAction* getInfoAction = UNBSSGetUserInfoAction::UNBSSGetUserInfoAction( this, // world context TokenInfo ); getInfoAction->OnComplete.AddDynamic(this, &MyClass::OnGetUserInfoComplete); getInfoAction->OnFail.AddDynamic(this, &MyClass::OnGetUserInfoFail); getInfoAction->Activate();
} void MyClass::OnAuthenticationFailed() { UE_LOG(LogTemp, Error, TEXT("SubscribeStar authentication failed: The user may have denied the request for their data") );
} void MyClass::OnGetUserInfoComplete(FNBSubscribeStarUserInfo UserInfo) { // now that we have the user's information, // we can check if they have subscribed to a tier with unlockable content if (UserInfo.HasActiveSubscription && UserInfo.TierID == "SpecialTierID") { UnlockSecretConent(); } else { // suggest the user should pledge to the Special Tier ;) }
} void MyClass::OnGetUserInfoFail() { UE_LOG(LogTemp, Error, TEXT("Fetching user info from SubscribeStar API failed: Was the access token invalid?") );
} For any questions, help, suggestions or feature requests, please feel free to contact me at nbpsup@gmail.com
